import LoginForm from "../components/LoginForm";
import Register from "../components/Register";
import { Router, Routes } from "react-router-dom";

function Auth() {
  return (
    <div className="Auth">
      <Routes>
        <Route path="login" element={<LoginForm />} />
        <Route path="register" element={<Register />} />
      </Routes>
    </div>
  );
}

export default Auth;
